    data: |
      SELECT + - col0 + + - ( col2 ) + - col0 - - col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN col0 AND - col1 + + 94 - 97;
  - name: tab1

outputs:
  - name: q5519.out
    data: |
